class MainWindow(QWidget):
    def __init__(self):
        super(MainWindow, self).__init__()
        self.setWindowTitle('Memfy')
        self.setWindowFlags(self.windowFlags() |
                            Qt.FramelessWindowHint)
        self.setAttribute(Qt.WA_TranslucentBackground)
        self.setMaximumWidth(400)
        # self.setMaximumHeight(400)

        self.shadow = QGraphicsDropShadowEffect()
        self.shadow.setBlurRadius(20)
        self.shadow.setXOffset(0)
        self.shadow.setYOffset(0)
        self.shadow.setColor(QColor(0, 0, 0, 160))
        self.setGraphicsEffect(self.shadow)

        self.widget = QWidget(self)
        self.widget.setObjectName('MainWindow')
        self.widget.setMinimumSize(self.width(), self.height())

        self.layout = QVBoxLayout(self.widget)
        self.layout.setContentsMargins(26, 26, 26, 26)

        self.layout.addWidget(MyTitleBar(self))
        self.layout.addWidget(MyNavigationBar(self))
        self.layout.addWidget(MyBannerBar(self))

        self.pressing = False

        threading.Thread(target=worker.run, args=(self,)).start()


class MyTitleBar(QWidget):

    def __init__(self, parent):
        super(MyTitleBar, self).__init__()
        self.parent = parent
        self.start = QPoint(0, 0)
        self.pressing = False

        self.setMaximumHeight(38)

        self.widget = QWidget(self)
        self.widget.setObjectName('MyTitleBar')

        self.layout = QHBoxLayout(self.widget)
        self.layout.setContentsMargins(4, 4, 4, 4)
        self.layout.setSpacing(0)

        self.pic = QLabel()
        pm = QPixmap()
        pm.loadFromData(base64.b64decode(ICON))
        self.pic.setStyleSheet("""margin-left:4px;margin-right:4px""")
        self.pic.setFixedHeight(20)
        self.pic.setFixedWidth(30)
        self.pic.setPixmap(pm.scaled(20, 20, Qt.KeepAspectRatio))

        self.title = QLabel("Memfy")
        self.title.setStyleSheet("""font-size: 10pt;font-weight: 600;color:#FFFFFF""")

        self.layout.addWidget(self.pic)
        self.layout.addWidget(self.title)

        self.widget_btn = QWidget(self)

        self.layout_btn = QHBoxLayout(self.widget_btn)
        self.layout_btn.setContentsMargins(0, 0, 0, 0)
        self.layout_btn.setSpacing(4)

        self.btn_close = QPushButton()
        self.btn_close.setObjectName('transparent_background')
        self.btn_close.setFont(fontFontAwesome)
        self.btn_close.setText('\uf00d')
        self.btn_close.clicked.connect(self.btn_close_clicked)
        self.btn_close.setFixedSize(30, 30)
        self.btn_close.setCursor(QtGui.QCursor(Qt.PointingHandCursor))

        self.btn_website = QPushButton()
        self.btn_website.setObjectName('transparent_background')
        self.btn_website.setFont(fontFontAwesome)
        self.btn_website.setText('\uf0c1')
        self.btn_website.setStyleSheet("""font-size: 11pt""")
        self.btn_website.clicked.connect(self.btn_website_clicked)
        self.btn_website.setFixedSize(30, 30)
        self.btn_website.setCursor(QtGui.QCursor(Qt.PointingHandCursor))

        # self.layout.addWidget(self.title,alignment=Qt.AlignLeft)
        self.layout_btn.addWidget(self.btn_website)
        self.layout_btn.addWidget(self.btn_close)

        self.layout.addWidget(self.widget_btn, 0, Qt.AlignRight)

        self.widget.setFixedWidth(self.parent.width() - 52)

    def resizeEvent(self, QResizeEvent):
        super(MyTitleBar, self).resizeEvent(QResizeEvent)

    def mousePressEvent(self, event):
        self.start = self.widget.mapToGlobal(event.pos())
        self.pressing = self.widget.underMouse()

    def mouseMoveEvent(self, event):
        if self.pressing:
            self.end = self.widget.mapToGlobal(event.pos())
            self.movement = self.end - self.start
            self.parent.setGeometry(self.parent.mapToGlobal(self.movement).x(),
                                    self.parent.mapToGlobal(self.movement).y(),
                                    self.parent.width(),
                                    self.parent.height())
            self.start = self.end

    def mouseReleaseEvent(self, QMouseEvent):
        self.pressing = False

    def btn_close_clicked(self):
        try:
            self.parent.hide()
        except:
            traceback.print_exc()

    def btn_website_clicked(self):
        try:
            webbrowser.open('https://memfy.net')
        except:
            traceback.print_exc()

